import { useState } from "react";


function App(){
    const [data,setData]=useState([])
    fetch("  http://localhost:3009/project")
    .then((res)=>{
        return res.json()
    })
    .then((resp)=>{
        setData(resp)
    },[])
    return(
        <div>
           <div style={{backgroundColor:"lightblue"}}>
            <img src="https://www.caranddriver.com/_assets/design-tokens/caranddriver/static/images/logos/logo.68b8e69.svg?primary=navLogoColor" style={{width:"100px",height:"80px"}}/>
              <input  style={{marginLeft:"150px",width:"600px",height:"40px",borderRadius:"50px"}} type="text"    placeholder="Search for more mustang cars"/>
              <i style={{marginLeft:"100px"}} class="fa-solid fa-bell fa-bounce fa-2xl"></i>
           </div>


                <div style={{display:"grid",gridTemplateColumns:"auto auto auto auto auto",gridRowGap:"20px"}}>
                   {data.map((ourdata)=>(
                    <div>
                      <div style={{width:"250px",height:"400px"}}>
                        <img src={ourdata.img} style={{width:"200px", height:"200px"}}/>
                        <h3>{ourdata.name}</h3>
                        <p>{ourdata.manufacturer}</p>
                        <p>{ourdata.production}</p>
                        <p>{ourdata.price}</p>
                        <span className="btn  btn-primary" >BUY THIS</span>
                        <span className="btn btn-success">ADD CART</span>
                      </div>
                      </div>
                   ))}
                </div>
        </div>
    )
}
export default App;
